import React, { Component } from 'react'
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'


export class Comp_3 extends Component {
    render() {
        return (
            <div>
                <Parallax pages={3} scrolling={false} vertical ref={ref => (this.parallax = ref)}>
                    <ParallaxLayer offset={0} speed={0.5}>
                        <span  onClick={() => this.parallax.scrollTo(1)}>

                            <div style={{divStyle}}>
                            SUP


                            </div>

                        </span>
                    </ParallaxLayer>
                </Parallax>

            </div>
        )
    }
}

export default Comp_3

const divStyle ={
    color: 'blue',
    textAlign: 'center'
}
